import React from 'react'

const MenuItem = ({item}) => {
    const alt = `${item.name} menu icon`
    return (
        <div className="menu-item" onClick={handleClick}>
            <img className="icon" src={item.icon} alt={alt}/>
            <p>{item.name}</p>
        </div>
    )
}

export default MenuItem
